            Desc:"ChatGPT is a chatbot developed by OpenAI and launched on November 30, 2022. Based on a large language model, it enables users to refine and steer a conversation towards a desired length, format, style, level of detail, and language"
        },
        {
            id: 2,
            img:"/imges/m2.jpg",
            Desc:"ChatGPT is a chatbot developed by OpenAI and launched on November 30, 2022. Based on a large language model, it enables users to refine and steer a conversation towards a desired length, format, style, level of detail, and language"
        },
        {
            id: 3,
            img:"/imges/m3.jpg",
            Desc:"ChatGPT is a chatbot developed by OpenAI and launched on November 30, 2022. Based on a large language model, it enables users to refine and steer a conversation towards a desired length, format, style, level of detail, and language"
        },
        {
            id: 4,
            img:"/imges/m4.jpg",
            Desc:"ChatGPT is a chatbot developed by OpenAI and launched on November 30, 2022. Based on a large language model, it enables users to refine and steer a conversation towards a desired length, format, style, level of detail, and language"
        },
        {
            id: 5,
            img:"/imges/m5.jpg",
            Desc:"ChatGPT is a chatbot developed by OpenAI and launched on November 30, 2022. Based on a large language model, it enables users to refine and steer a conversation towards a desired length, format, style, level of detail, and language"
        },
        

    ]
    const style ={
        color:"black"
    }
  return (
    <>
    <div className='qualities'>
    <h2>Our Qulities</h2>
    <div className='container'>
   {
    data.map((ele)=>{
        return(
            <div className='card' key={ele.id}>
                <div className='img-wrapper'>
                   <img src={ele.img} alt='qualities'/>
                </div>
            <div className='content'>
            <h3 className='title' style={style}>{ele.Desc}</h3>
            </div>
            </div>
        
        )
    })
   }
    </div>
    </div>
   
    
    
    </>
  )
}
